import BrainFlixLogo from '../../Assets/Logo';


function Header() {
    return (

        <header>
            {/* <!-- logo --> */}
            <img src={BrainFlixLogo} alt="LOGO" />
            {/* <!-- search bar --> */}
            <input type="search" placeholder="Search" />
            {/* <!-- upload button --> */}
            <button>UPLOAD</button>
            {/* <!-- Image avatar --> */}
            <img src="" alt="Avatar" />
        </header>
    )
};
 export default Header;
